import React from 'react';
import { Box } from '@mui/material';

const GroupListComponent = () => {
  return (
    <Box
      sx={{
        width: '15%',
        bgcolor: '#f5f5f5',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        p: 2,
      }}
    >
      <Box
        sx={{
          width: '80%',
          bgcolor: '#e0e0e0',
          height: '50%',
          mt: 2,
          p: 1,
          display: 'flex',
          flexDirection: 'column',
          gap: 1,
        }}
      >
        {[1, 2, 3].map((item) => (
          <Box
            key={item}
            sx={{
              width: '100%',
              height: 50,
              bgcolor: '#ddd',
              borderRadius: 1,
            }}
          ></Box>
        ))}
      </Box>
    </Box>
  );
};

export default GroupListComponent;
